import React from 'react';

export default class Welcome extends React.Component<any> {

    constructor(props:any){
        super(props);
        this.state ={
                user : this.props.user,
        }
    }


    render(){
        let role;
        switch(this.props.permission){
            case 1: role = "Admin";
            break;
            case 2: role = "Editor";
            break;
            case 3: role = "Writer";
            break;
            default: role = "";


        }
        return(

            <>
            <div className="logoo"> 
                <span>
                    Hi {this.props.username},
                </span>
                <span className="farmost">
                    {role}
                </span> 
                </div>
            </>
        )
    }
}
